SELECT ?E_CO WHERE {
		["平安股息精选A", "平安股息精选C"] buildin:edges("经营基金") ?E_CO
	}

SELECT ?X WHERE {
		"龙腾照明集团股份有限公司的供应商" buildin:vertices ?X
	}

SELECT ?X WHERE {
		["圣阳电源股份有限公司的董事会成员", "盛新锂能股份有限公司的董事会成员"] buildin:vertices ?X
	}

SELECT ?E_CO WHERE {
		"毛时超的经营基金" buildin:containEdges("经营基金") ?E_CO
	}

SELECT ?E_CO WHERE {
		"DANIEL_DONGNING_SUN的经营基金" buildin:inEdges("经营基金") ?E_CO
	}

SELECT ?E_CO WHERE {
		"一品红药业股份有限公司的客户" buildin:intersectEdges("客户", 2) ?E_CO
	}

SELECT ?V WHERE {
		"华润医药商业集团有限公司" buildin:intersectVertices("客户", 2) ?V
	}

SELECT ?X ?E_Holder WHERE {
		"金财互联控股股份有限公司的董事会成员" buildin:vertices ?X 
		?X buildin:edges("持股") ?E_Holder
	 }

SELECT ?E_Host ?E_Manage WHERE {
		?E_Host buildin:etype "托管基金"
		?E_Host buildin:containEdges("管理基金") ?E_Manage
	}

SELECT ?E_MF ?X WHERE {
		?E_MF buildin:etype "管理基金"
		?E_MF buildin:vertices ?X
	}

SELECT ?Person1 ?E_Manager ?Person2 WHERE {
		?E_Manager buildin:etype "基金的经理"
		?E_Manager buildin:vertices ?Person1
		?Person1 buildin:intersectVertices("基金的经理", 5) ?Person2
	}

SELECT ?Person ?E_Party ?E_Board ?E_Leader WHERE {
		?E_Party buildin:etype "党群干部"
		?E_Party buildin:vertices ?Person
		?Person buildin:edges("董事会成员") ?E_Board
		?Person buildin:edges("高管成员") ?E_Leader
	}
